 本帖最后由 Ponyville 于 2020-8-9 23:35 编辑 

是的经过我扣了一晚上递归，终于写好了查找主题的功能~
上代码：

#!/usr/bin/env node
const ROOT = process.env.HOME || process.env.USERPROFILE;
const log = require("../libs/log");
const net = require("../libs/nget");
const program = require("commander");
const finder = require("../libs/finder");
const fs = require("fs");

program.option("-v, --verbose", "output debug info");
program
  .command("add-repo <repo name> <repo link>")
  .description("add a repo record for installer to search")
  .action((name, link) => {
    addRepo(name, link);
  });
program
  .command("remove-repo <repo name>")
  .description("remove an existing repo record")
  .action((name) => {
    rmRepo(name);
  });
program
  .command("install <theme name>")
  .description("install a theme from repos using its name");
program.command("uninstall <theme name>").description("uninstall a theme");

program
  .command("query <theme name>")
  .description("query the link of a theme and use it for online loading")
  .action((name) => {
    query(name);
  });
if (!fs.existsSync(ROOT + "/.ntfine")) {
  fs.mkdirSync(ROOT + "/.ntfine");
  var str = '{"content":[]}';
  fs.writeFileSync(ROOT + "/.ntfine/repo.json", str);
}
if (!fs.existsSync(ROOT + "/.ntfine/repo.json")) {
  var str = '{"content":[]}';
  fs.writeFileSync(ROOT + "/.ntfine/repo.json", str);
}

program.parse(process.argv);
if (program.verbose) {
  log.doDebug = true;
}
function addRepo(repo_name, repo_link) {
  var repoStr = fs.readFileSync(ROOT + "/.ntfine/repo.json").toString();
  var repo = eval("(" + repoStr + ")");
  for (n in repo.content) {
    if (repo.content[n].name == repo_name) {
      log.fatal(
        "add repo",
        "repo '" +
          repo_name +
          "' already exists, use 'ntf-get remove-repo " +
          repo_name +
          "' and then try to add it again."
      );
      process.exit(1);
    }
  }
  var r = new Object();
  r.name = repo_name;
  r.href = repo_link;
  repo.content[repo.content.length] = r;
  log.info(
    "add repo",
    "added new repo '" + repo_name + "' with href as '" + repo_link + "'"
  );
  fs.writeFileSync(ROOT + "/.ntfine/repo.json", JSON.stringify(repo));
}

function rmRepo(repo_name) {
  var repoStr = fs.readFileSync(ROOT + "/.ntfine/repo.json").toString();
  var repo = eval("(" + repoStr + ")");
  for (n in repo.content) {
    if (repo.content[n].name == repo_name) {
      repo.content.splice(n, 1);
      log.info("remove repo", "removed repo '" + repo_name + "'");
      fs.writeFileSync(ROOT + "/.ntfine/repo.json", JSON.stringify(repo));
      process.exit(0);
    }
  }
  log.warn("remove repo", "no repo name '" + repo_name + "', dismissed.");
}

async function traceName(name, cname_link, counter) {
  var ct;
  var clink = cname_link;
  if (cname_link.substr(-1, 1) != "/") {
    clink = cname_link + "/";
  }
  await net.getSync(clink + "repo.json").then(function (res) {
    ct = res.data;
  });

  var repo = eval(ct);

  for (n in repo.content) {
    if (repo.content[n].name == name) {
      if (repo.content[n].type == "a") {
        counter.count += 1;
        log.info(
          "query result",
          "response from '" +
            repo.name +
            "': '" +
            name +
            "' -> '" +
            repo.content[n].value +
            "'"
        );
        if (!repo.content[n].official) {
          log.warn(
            "unofficial response",
            "the response '" +
              repo.content[n].value +
              "' is not an official response, check it before load!"
          );
        } else {
          counter.ocount += 1;
        }
      } else if (repo.content[n].type == "p") {
        log.debug("redirect", "redirected to '" + repo.content[n].value + "'");
        traceName(name, repo.content[n].value, counter);
      }
    }
  }
}

function query(name) {
  var a = {
    count: 0,
    ocount: 0,
  };
  var repoStr = fs.readFileSync(ROOT + "/.ntfine/repo.json").toString();
  var repo = eval("(" + repoStr + ")");
  log.info("query repo", "start querying");
  for (r in repo.content) {
    log.info("query repo", "querying '" + repo.content[r].name + "'");
    traceName(name, repo.content[r].href, a);
s}
  process.on("beforeExit", function () {
    log.info(
      "finished",
      "query finished, " +
        log.CHALK.green(a.count.toString()) +
        " responses and " +
        log.CHALK.greenBright.bold(a.ocount.toString()) +
        " official responses found."
    );
  });
}复制代码


