此外：NTanFine登陆NPM啦！
现在您可以使用npm安装ntanfine：
npm install ntanfine-launcher -g复制代码
（测试版，功能不完善）
可以使用：
- ntf-cli install 来下载加载器，下载的位置是当前目录/.ntfine/content/<版本号>，其中<版本号>文件夹就是一个Chrome插件，可以直接载入。
- ntf-get query <名称> 在所有仓库查找主题（虽然好像就只有mcbbs和equestria）
- ntf-get add-repo <名称> <URL> 添加主题仓库
- ntf-get remove-repo <名称> 移除仓库


现在仅有的两个仓库是https://ntfine.xuogroup.top/repo1 和 https://ntfine.xuogroup.top/repo-classic


祝我好运吧！


